import React from 'react';

import Component, { makeStyles } from '@material-ui/core/'

const useStyle = makeStyles(
    {
        root: {
            position: 'absolute',
            zIndex: 100,
            width: 100,
            height: '100vh',
        },
    }
);

const Background = () => {
    const classes = useStyle();

    return (
        <img className={classes.root} />
    );
}

export default Background;
